import React from 'react';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';

class CartCourse extends React.Component {
    render() {
        return(
            <Card style={{width: '33%', marginTop: '5px', marginBottom: '5px'}}>
                <Card.Body>
                    <Card.Title>{this.props.data.name}</Card.Title>
                    <Card.Subtitle className="mb-2 text-muted">{this.props.data.number}}</Card.Subtitle>
                    <Button variant="primary">Remove</Button>
                </Card.Body>
            </Card>
        )
    }

    cartList(){
        let courses = [];

    for(const course of Object.entries(this.props.data)) {
      courses.push (
        <Course key={course[0]} data={course[1]} setCartCourses={(data)=>this.props.setCartCourses(data)}/>
      )
    }

    return courses;
    }
}

export default CartCourse;
